import React from "react";
import {Col, Row, FormGroup, Label, Button, ModalBody, ModalFooter, Input, CustomInput} from "reactstrap";
import Translate from "../../../Translate";
import jwt from "jwt-simple";

const UserModal = (props) => {
    let user = props.user

    function handleInputChange(key, value) {
        let new_value = {}
        new_value[key] = value
        props.setModalValues(new_value)
    }

    function handleClick() {
        props.addUser(props.user)
    }

    return (
        <React.Fragment>
            <ModalBody>
                <Row>
                    <Col md="12">
                        <FormGroup>
                            <Label for="firstName"><Translate name="name"/></Label>
                            <input
                                className="form-control"
                                type="text"
                                id="name"
                                onChange={event => handleInputChange("name", event.target.value)}
                                required
                            />
                        </FormGroup>
                    </Col>
                    <Col md="12">
                    <ul className="list-group icheck-task">
                        <li className="list-group-item">
                            <div className="custom-control custom-checkbox mb-2 mr-sm-2 mb-sm-0">
                                <input defaultChecked={true} type="checkbox" className="custom-control-input" id="1st-item" />
